          </Route>

          <Route path="/Stocks" exact component={StocksPage}>
              <StocksPage />
          </Route>

          <Route path="/Dashboard" exact component={HomePage}>
            <HomePage />
          </Route>

        </Switch>
      </BrowserRouter>
    )
